import React from "react";
import { BrowserRouter as Router } from "react-router-dom";
import AdminDashboard from "./Compornet/AdminDashboard";
import ErrorBoundary from "./Compornet/"; // エラーバウンダリをインポート

function App() {
  return (
    <Router>
      <ErrorBoundary>
        <div>
          <AdminDashboard />
        </div>
      </ErrorBoundary>
    </Router>
  );
}

export default App;
